script: |
  super -f text -I q12310.spq | sort > q12310.out

inputs:
  - name: q12310.spq
    data: |
      SELECT DISTINCT - + CAST ( + - col2 AS REAL ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - col1 + + 56 + + 89 IN ( + col0 * - + 85, col2, ( + 55 ) ) );
  - name: tab2

outputs:
  - name: q12310.out
    data: |
